import "./App.css";
import "./css/Login.css";

import React, { useState, useEffect } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link,
    useLocation,
    useParams
} from "react-router-dom";
import NotFound from "./Reactjs/NotFound";
// import DetailPro from "./DetailPro.js";
import Cart from "./Reactjs/Cart.js";
import Login from "./Reactjs/Login";
import Admin from "./Reactjs/admin";
import MenuBar from "./home/Menu";
import Slider from "./home/Slider";
import Footer from "./home/Footer";
import Phantrang from "./Reactjs/PhanTrang";
import DetailPro from "./Reactjs/DetailPro";
import Products from "./Reactjs/Products";
import Add from "./Reactjs/Add";


function App() {
    return (
        <Router>
            <Routes>
                <Route exact path="/" element={<Products/>}/>

                <Route path="/DetailPro/:id" element={<DetailPro/>}>

                </Route>
                <Route path="/phonepage/:numberpage" element={<Phantrang/>}>
                    <MenuBar />
                    <Slider />
                    <Phantrang />
                </Route>
                <Route path="/Cart" element={true}>
                    <MenuBar />
                    <Cart />
                    <Footer />
                </Route>
                <Route path="/Login" element={true}>
                    <Login />
                </Route>
                <Route path="/Admin" element={true}>
                    <Admin />
                </Route>
                <Route path="/Add" element={<Add/>}>
                    <Add />
                </Route>
                <Route path="/*" element={<NotFound />} />

            </Routes>
        </Router>
    );
}


export default App;
